import "./index.css";
import Home from "./components/Home";
import AdminPage from "./components/AdminPage";
import FeaturedProperty from "./components/FeaturedProperty";
import PropertyModel from "./components/PropertyModel";
import Contact from "./components/ContactComponent";
import Footer from "./components/Footer";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";

function App() {
  const [selectedProperty, setSelectedProperty] = useState(null);

  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/admin/signin" element={<Signing />} />
          <Route path="/admin/admin-page" element={<AdminPage />} />
          <Route path="/admin/admin-page" element={<Footer />} />
          <Route path="/admin/admin-page" element={<Contact />} />
        </Routes>
      </Router>

      <FeaturedProperty setSelectedProperty={setSelectedProperty} />
      {selectedProperty && (
        <PropertyModel
          properties={[selectedProperty]}
          onClose={() => setSelectedProperty(null)}
        />
      )}
    </div>
  );
}

export default App;
